INSERT INTO `node_revisions` (`nid`,`vid`,`uid`,`title`,`body`,`teaser`,`log`,`timestamp`,`format`) VALUES 
 (1,1,1,'Welcome ','Welcome to Bushwalking Club   ','Welcome to Bushwalking Club   ','',1305267716,2),
 (7,7,1,'a story','this is a story','this is a story','',1302166833,1),
 (3,3,1,'about','If you\'re looking for outdoor adventures or want to learn about such things as navigation and bushcraft then Brisbane Water Outdoors Club is the club for you.\r\n\r\nActivities include bushwalking (day walks, overnight bushwalks and multi day bushwalks), canyoning, abseiling, canoeing & kayaking, mountain biking and sometimes skiing and snowshoeing.\r\n\r\nBushwalking trips can be day walks on the Central Coast or overnight walks and car camps further afield.\r\n\r\nSome of our activities require some specialised skills and experience and the Club holds regular practise days should you wish to develop an interest in a particular activity (e.g. abseiling or kayaking).\r\n\r\nVisitors are welcome to come to our Monthly General Meetings which are, as a rule, held on the first Wednesday of the month commencing at 7.30 pm at the Narara Neighbourhood Centre, 2 - 12 Pandala Road, Narara. \r\n\r\n<h1 class=\"membeship-i\"  >\r\nRMIT UNI - ISYS1083 Object Oriented Software Design </h1>\r\n<hr/>\r\n<br /><br /><br />\r\n<h1 class=\"thankyou\"  >\r\n    * Amruta Varshini - TL (s3272373)\r\n    * Emil B. Kjer (s3298554)\r\n    * Victor Nava (s3252905)\r\n    * John Kolovos (s3289732)\r\n    * Stefan Fuch (s3260968)\r\n\r\n</h1>','If you\'re looking for outdoor adventures or want to learn about such things as navigation and bushcraft then Brisbane Water Outdoors Club is the club for you.\r\n\r\nActivities include bushwalking (day walks, overnight bushwalks and multi day bushwalks), canyoning, abseiling, canoeing & kayaking, mountain biking and sometimes skiing and snowshoeing.\r\n\r\nBushwalking trips can be day walks on the Central Coast or overnight walks and car camps further afield.\r\n\r','',1305399855,2),
 (4,4,1,'the home page is up and running','the home page is up and running thanks to malakas work','the home page is up and running thanks to malakas work','',1302157772,1),
 (5,5,1,'another story','the second news blah blah blha','the second news blah blah blha','',1302157836,1),
 (6,6,1,'Rent Equipment','The reant equipment page goes here','The reant equipment page goes here','',1302164506,1),
 (8,8,1,'John Chapman - Bushwalking In Australia','','','',1305266377,2),
 (9,9,1,'Ultra Lightweight ','bushwalking equipment\r\n\r\n<a href=\"\"><img src=\"http://bushwalk.com/forum/download/149x99xfile.php,qavatar=2147_1266405168.jpg.pagespeed.ic.FpmoHAwfM_.jpg\" /></a>','bushwalking equipment\r\n\r\n<a href=\"\"><img src=\"http://bushwalk.com/forum/download/149x99xfile.php,qavatar=2147_1266405168.jpg.pagespeed.ic.FpmoHAwfM_.jpg\" /></a>','',1305266345,2),
 (10,10,1,'Bushwalking - Safety & Equipment','Bushwalking - Safety & Equipment','Bushwalking - Safety & Equipment','',1305266444,2),
 (11,11,1,'Bogong','Gear for serious outdoor adventurers\r\nChoose your adventure:\r\n\r\nhttp://www.bogong.com.au/ \r\n\r\n<img src=\"http://www.bogong.com.au/assets/images/bog_log_col_80.jpg\"/>','Gear for serious outdoor adventurers\r\nChoose your adventure:\r\n\r\nhttp://www.bogong.com.au/ \r\n\r\n<img src=\"http://www.bogong.com.au/assets/images/bog_log_col_80.jpg\"/>','',1305266312,2),
 (12,12,1,'What is the Confederation of Bushwalking Clubs?','If you\'re looking for outdoor adventures or want to learn about such things as navigation and bushcraft then Brisbane Water Outdoors Club is the club for you.\r\n\r\nActivities include bushwalking (day walks, overnight bushwalks and multi day bushwalks), canyoning, abseiling, canoeing & kayaking, mountain biking and sometimes skiing and snowshoeing.\r\n\r\nBushwalking trips can be day walks on the Central Coast or overnight walks and car camps further afield.\r\n\r\nSome of our activities require some specialised skills and experience and the Club holds regular practise days should you wish to develop an interest in a particular activity (e.g. abseiling or kayaking).\r\n\r\nVisitors are welcome to come to our Monthly General Meetings which are, as a rule, held on the first Wednesday of the month commencing at 7.30 pm at the Narara Neighbourhood Centre, 2 - 12 Pandala Road, Narara. ','If you\'re looking for outdoor adventures or want to learn about such things as navigation and bushcraft then Brisbane Water Outdoors Club is the club for you.\r\n\r\nActivities include bushwalking (day walks, overnight bushwalks and multi day bushwalks), canyoning, abseiling, canoeing & kayaking, mountain biking and sometimes skiing and snowshoeing.\r\n\r\nBushwalking trips can be day walks on the Central Coast or overnight walks and car camps further afield.\r\n\r','',1305265961,1),
 (13,13,1,'JOINING\'S AS EASY AS 1, 2, 3','1. Contact us with your details and someone will be in touch with you to give you more information about the Club and its activities or come along to one of our meetings to meet other members.\r\n\r\n2. Try out one of the activities to make sure that you really enjoy bushwalking (or any of the other activities we undertake) and that the level of social activity is also what you\'re looking for. Be aware that each activity you undertake as a temporary member will attract a fee of $5 and visitors can do up to three activities before they must make a decision on whether or not to join.\r\n\r\n3. Once you have determined that you indeed wish to be a member of our Club use the Contact Us page to request a membership form, fill it out and mail to P. O. Box 845, Gosford, NSW 2250 with your membership fee. Upon receipt, your application to become a member will be nominated and seconded by members of the Club. You\'ll then be on our email list for monthly newsletters (and other notices of equipment sales, short notice trips etc).\r\n\r\n2010/11 MEMBERSHIP FEES (Membership runs from 1st July - 30th June each year)\r\n\r\nSingle Membership: $25 per annum (1st July - 30th June)\r\n\r\nTemporary Members: $5 per activity which gives you the opportunity to see if this Club is for you.\r\n\r\nThe Club does not accept membership for children under the age of 18. However, some leaders will accept children to participate in an activity (subject to any special participation requirements) as a temporary member, for a nominal fee of $1 each activity as long as they are accompanied by a parent or legal guardian.\r\n\r\nMembership Fees can be paid by cash, cheque or direct debit.\r\n\r\nMailing Address:  Brisbane Water Outdoors Club, P. O. Box 845, Gosford, NSW 2250','1. Contact us with your details and someone will be in touch with you to give you more information about the Club and its activities or come along to one of our meetings to meet other members.\r\n\r\n2. Try out one of the activities to make sure that you really enjoy bushwalking (or any of the other activities we undertake) and that the level of social activity is also what you\'re looking for. Be aware that each activity you undertake as a temporary member will attract a fee of $5 and visitors can do up to three activities before they must make a decision on whether or not to join.\r\n\r','',1305266016,1),
 (14,14,1,'Bushwalking Club Insurance','We organise personal accident and public liability insurance for our affiliated clubs. Each type of insurance provides the respective cover for members of affiliated clubs who participate in club activities such as bushwalking, alpine walking (summer and winter), orienteering, rogaining, liloing, abseiling, canyoning, caving, canoeing, kayaking, rafting, swimming, cycling and snow skiing.\r\n\r\nHowever, it should be noted that insurance cover for abseiling, caving and snow skiing is dependant upon the participant signing a suitable risk waiver. Confederation maintains risk management policies which include sample risk waiver forms drafted in accordance with the provisions of Part 1A, Division 5 of the Civil Liability Act 2002 (NSW).','We organise personal accident and public liability insurance for our affiliated clubs. Each type of insurance provides the respective cover for members of affiliated clubs who participate in club activities such as bushwalking, alpine walking (summer and winter), orienteering, rogaining, liloing, abseiling, canyoning, caving, canoeing, kayaking, rafting, swimming, cycling and snow skiing.\r\n\r','',1305266061,1),
 (15,15,1,'What is the Confederation of Bushwalking Clubs?','The Confederation is the peak New South Wales organisation for non-commercial bushwalking and associated outdoor recreation activities. We are a confederation of individual Bushwalking Clubs across the state of NSW, and we were formed in 1932 to represent the interests of our member Bushwalking Clubs.\r\nThe NSW Confederation is in turn a member of the National body Bushwalking Australia.\r\nServices to the clubs\r\n\r\nOur duties are to perform services that enable the efficient functioning of our member clubs. We promote the adoption of sound environmental conservation practices, we inform our member clubs about relevant Tracks and Access issues, we promote Inter-club social activities, we engage in safety training and lately we have provided Internet web-hosting facilities to member clubs.\r\nBushwalking Club Insurance\r\n\r\nWe organise personal accident and public liability insurance for our affiliated clubs. Each type of insurance provides the respective cover for members of affiliated clubs who participate in club activities such as bushwalking, alpine walking (summer and winter), orienteering, rogaining, liloing, abseiling, canyoning, caving, canoeing, kayaking, rafting, swimming, cycling and snow skiing.\r\n\r\nHowever, it should be noted that insurance cover for abseiling, caving and snow skiing is dependant upon the participant signing a suitable risk waiver. Confederation maintains risk management policies which include sample risk waiver forms drafted in accordance with the provisions of Part 1A, Division 5 of the Civil Liability Act 2002 (NSW).','The Confederation is the peak New South Wales organisation for non-commercial bushwalking and associated outdoor recreation activities. We are a confederation of individual Bushwalking Clubs across the state of NSW, and we were formed in 1932 to represent the interests of our member Bushwalking Clubs.\r\nThe NSW Confederation is in turn a member of the National body Bushwalking Australia.\r\nServices to the clubs\r\n\r','',1305266089,1),
 (16,16,1,'Member Bushwalking Clubs','Member Bushwalking Clubs\r\n\r\nOur member clubs participate in a large range of outdoor activities geared to individual age groups. Many clubs are centred about Sydney and Canberra, but we also represent a large number of country clubs scattered around the state. Older age-group clubs are more sedentary but often walk during the week. Some clubs run day walks for novices and overnight camping walks for experienced bushwalkers cater. Younger, more adventurous clubs actively participate in map and compass exploratory bushwalking, canyoning, canoeing, kayaking, mountain biking and other outdoor pursuits.\r\nWhere do our clubs walk?\r\n\r\nBushwalking is done all over Australia, but primarily in our National Parks, Forests and Reserves, encompassing mountain, forest, rain forest and desert areas. They include the World Heritage Blue Mountains National Park, Snowy Mountains, Wollemi National Park, Royal National Park (the second oldest National Park in the world), Barrington Tops National Park, Morton National Park, Kanangra Boyd National Park. These are just a few of the many notable National Parks in New South Wales (NSW) and the Australian Capital Territories (ACT).','Member Bushwalking Clubs\r\n\r','',1305266120,1),
 (17,17,1,'Field Members','Experienced bushwalkers and canyoners, who can travel through rough terrain safely and quickly, day or night, in any weather.  All searchers hold a current St John First Aid Certificate or equivalent and are self sufficient in the bush for up to two days and one night (with reserves for a further 24 hrs) on any operation. Skills amongst Members include:\r\n\r\n    * bushwalking and wilderness exploration/navigation\r\n    * land search and rescue\r\n    * remote area first aid\r\n    * All Members hold current St Johns Senior First Aid or equivalent\r\n    * vertical rescue (including VM, V1 and V3 qualified operators and instructors)\r\n    * canyon search and rescue\r\n    * rock climbing\r\n    * work around helicopters\r\n    * alpine work\r\n','Experienced bushwalkers and canyoners, who can travel through rough terrain safely and quickly, day or night, in any weather.  All searchers hold a current St John First Aid Certificate or equivalent and are self sufficient in the bush for up to two days and one night (with reserves for a further 24 hrs) on any operation. Skills amongst Members include:\r\n\r\n    * bushwalking and wilderness exploration/navigation\r\n    * land search and rescue\r\n    * remote area first aid\r\n    * All Members hold current St Johns Senior First Aid or equivalent\r','',1305266158,1),
 (18,18,1,'Wilderness Rescue Proficiency','Our strength comes from the bushwalking clubs who, throughout their activities, train their members in bush sense and skills, as well as building up their fitness.\r\n\r\nAll our members are experienced in \'bushcraft\' skills (finding a path through cliff lines, river crossing, rough camping, cooking, fire lighting, etc) and many have exceptional bush navigation skills.\r\n\r\nTo enable our members to function effectively in the bush and increase their skills, we hold regular training days and weekends. \r\n\r\nWe also hold familiarisation trips for members, which are basically bushwalks or canyon trips, that give our members the chance to familiarise themselves with wilderness areas where they may not normally go.  The emphasis on all these activities is that they are fun to participate in, while enhancing the high skill level that is required by the Squad.\r\n\r\nThree activities a year are conducted to train and refresh bushwalkers in wilderness rescue operations. These include:\r\n\r\n    * search techniques\r\n    * first aid\r\n    * stretcher hauling\r\n    * radio usage\r\n    * navigation\r\n    * bush safety\r\n    * river crossing\r\n\r\nWithin the BWRS, there is also a small core of dedicated rock climbers/canyoners, referred to as The Rock Squad, who perform those tricky jobs such as cliff rescue which are beyond the skills of the average bushwalker. The members of this squad hold the ALVRI Vertical Rescue Operator VM, V1, V2, V3 vertical rescue qualification, and regularly train with other VRA organisations who are also accredited for vertical rescue.  A number of our members are also qualified Instructors for this training.','Our strength comes from the bushwalking clubs who, throughout their activities, train their members in bush sense and skills, as well as building up their fitness.\r\n\r\nAll our members are experienced in \'bushcraft\' skills (finding a path through cliff lines, river crossing, rough camping, cooking, fire lighting, etc) and many have exceptional bush navigation skills.\r\n\r\nTo enable our members to function effectively in the bush and increase their skills, we hold regular training days and weekends. \r\n\r','',1305266185,1);
